import React, {useState} from 'react';
import GetURLs from "./components/URLs/GetShortUrls";
import ShowTinyUrl from "./components/URLs/ShowTinyUrl";


function App() {
  const [result,setResult] = useState('');

  const getTinyUrl = (tinyUrl) => {
      setResult(tinyUrl)
  }

  return (
    <div>
      <GetURLs onGetTinyUrl={getTinyUrl}/>
      <ShowTinyUrl result={result}/>
    </div>
  );
}

export default App;
